script:
const size = { x: 32, y: 16, z: 48 };
const origin = { x: -16, z: -24 };
const simplex = new SimplexNoise(Math.random());

reset();

box(
  origin.x - 1, 0, origin.z - 1,
  size.x + 2, size.y, size.z + 2,
  3
);

box(
  origin.x, 1, origin.z,
  size.x, size.y, size.z,
  1
);

box(
  origin.x + 1, 2, origin.z + 1,
  size.x - 2, size.y - 1, size.z - 2,
  0
);

box(
  origin.x + 11, 2, origin.z + size.z - 7,
  10, 5, 1,
  2
);
box(
  origin.x + 12, 2, origin.z + size.z - 7,
  8, 4, 1,
  0
);


const elevator = {
  x: origin.x + 12,
  y: 0,
  z: origin.z + size.z - 1,
};
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  3
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
